        borderColor: '#FF5D67',
        height: 50,
        alignItems: "center",
        justifyContent: "center",
        bottom: 100,
        backgroundColor: "transparent",
        marginBottom: 10
    },
    Btn3: {
        position: 'absolute',
        right:80,
        width: "20%",
        borderRadius: 25,
        borderWidth: 3,
        borderColor: '#5DAFFF',
        height: 50,
        alignItems: "center",
        justifyContent: "center",
        bottom: 100,
        backgroundColor: "transparent",
        marginBottom: 10
    },
    btnContainer:{
        position: 'absolute',
        top: 200,
        alignItems: "center",
        flexDirection: 'row',
    },
    registerBtn: {
        width: "60%",
        borderRadius: 25,
        height: 50,
        alignItems: "center",
        justifyContent: "center",
        bottom: 50,
        backgroundColor: "transparent",
    },
    logo: {
        width:100,
        height:100,
    },
    logoContainer:{
        position: 'absolute',
        top: 200,
        alignItems: "center",
        // color: "fff"
    },
    logoText: {
        paddingTop: 15,
        color: 'white',
        fontSize : 20,
        // fontStyle: fontStyles[],
        fontWeight: "bold",
    },
    info: {
        position: "absolute" ,
        // paddingTop: 35,
        color: 'white',
        fontSize : 14,
        // fontStyle: fontStyles[],
        bottom: 30,
        left: 60,
        right:60,
        
    },
    loginText1: {
        color:"black",
